//+- -----------------------------------------------+   
// Diameter for the first Pipe<br />
dp1= 30;<br />
// Diameter for the first Pipe<br />
dp2= 10;<br />
//Thinkness=5;<br />
ep=3;
//hole for colson, rilsan or hose clamp<br />
dh=1;//hole diameter for the hose clamp, &quot;0&quot; for no-hole.<br />
$fn=50;
orientation=0;//Orientation in degree (zero for straight)
translate([-(dp2+ep)/2,0,0])rotate([0,0,180])ring(dp2,0);<br />
translate([(dp1+ep)/2,0,0])ring(dp1,orientation);
module ring(dp,or){;<br />
difference(){<br />
hull(){<br />
rotate([or,0,0])cylinder(d=dp+ep,h=ep, center=true);<br />
translate([-(dp+ep)/2,0,0])rotate([90,0,0])cylinder(d=ep,h=2<em >ep, center=true);<br />
}<br />
rotate([or,0,0]){<br />
union(){<br />
cylinder(d=dp,h=dp, center=true);<br />
rotate([0,0,225]) translate([-dp,0,-dp</em>3])cube([dp,dp,6<em >dp]);<br />
translate([-(dp+ep)/2,0,0])rotate([90,0,0])cylinder(d=dh,h=3</em>ep, center=true);<br />
}<br />
}<br />
translate([-(dp+ep)/2,0,0])rotate([90,0,0])cylinder(d=dh,h=dp*ep, center=true);<br />
}<br />
}
